import React from 'react';

const Input = (props) => {
    return (
        <div className="form-group">
            <label htmlFor={props.name} className="fontifyr">
                {props.label}
            </label>
            <input
                value={props.value}
                id={props.name}
                type="text"
                className="form-control"
                onChange={props.onChange}
                name={props.name}
            />
        </div>
    );
};

export default Input;
